      "created_at" : "Tue Jun 16 04:27:22 +0000 2020",
      "favorited" : false,
      "full_text" : "In that case, getClientBoundingRect() returns a rectangle around the entire rotated key - a rectangle which is now larger than the key itself. The offsets I was using resulted in coordinates that were not actually inside the key, though they were inside its bounding rect.",
      "lang" : "en",
      "in_reply_to_screen_name" : "mrled",
