      "favorited" : false,
      "full_text" : "I wanted to authorize devices automatically over the API. The devices are in a \"connections\" property in a JSON object, and the value of that key is a list containing one object per device. Each device object has a unique \"deviceID\" property.",
      "lang" : "en",
      "in_reply_to_screen_name" : "mrled",
