      "created_at" : "Sat Jun 27 16:47:42 +0000 2020",
      "favorited" : false,
      "full_text" : "I also wrote an Ansible filter plugin for use in my Syncthing role. Syncthing exposes an HTTP API that allows GET or POST of an entire configuration. To make a change to just one part of the configuration, you have to GET, update the result, then POST the updated config.",
