      "created_at" : "Sat Jun 27 16:43:55 +0000 2020",
      "favorited" : false,
      "full_text" : "(It's true that there are discovery servers already running on the Internet already, but they are only used for allowing peer discovery when both machines are behind firewalls - and they only exchange public key data, which is tautologically public. They're also optional.)",
      "lang" : "en",
      "in_reply_to_screen_name" : "mrled",
