      "created_at" : "Sat Jun 27 16:42:45 +0000 2020",
      "favorited" : false,
      "full_text" : "You can use it without configuring any servers, and without giving control of your data to a third party (unlike the file sync heavyweights like Dropbox, iCloud, etc).",
      "lang" : "en",
      "in_reply_to_screen_name" : "mrled",
