      "created_at" : "Sat Jun 27 16:41:48 +0000 2020",
      "favorited" : false,
      "full_text" : "It works a lot like Resilio Sync (nÃ©e Bittorrent Sync). It's not based on the Bittorrent protocol from what I can tell, but it does similarly divide files into chunks and pulls chunks from other machines in the cluster.",
      "lang" : "en",
      "in_reply_to_screen_name" : "mrled",
