      "created_at" : "Sat Jun 27 21:17:31 +0000 2020",
      "favorited" : false,
      "full_text" : "It uses the Python standard library's implementation of RFC4122 name-based UUIDs. The work was basically already done! I just had a few lines of code to actually implement it.",
