      "favorited" : false,
      "full_text" : "I wrote a name based UUID filter plugin for Ansible to accomplish this. It can generate UUIDs based on a name and a namespace, where the same name/namespace will always result in the same UUID.\n\nhttps://t.co/di4kYTTmEk",
      "lang" : "en",
