      "in_reply_to_status_id" : "1276987156729380864",
      "created_at" : "Sat Jun 27 21:15:03 +0000 2020",
      "favorited" : false,
      "full_text" : "In upstream Algo, the UUIDs are just regenerated every time, because the whole infrastructure (including the VPN server) id intended to be thrown away periodically. I wanted something idempotent, where I got the same result no matter how many times I re-ran the Ansible playbook.",
