      "created_at" : "Thu Dec 17 17:15:13 +0000 2020",
      "favorited" : false,
      "full_text" : "As a result, users will have to register a Twitter \"app\" to get the four tokens required to authenticate via the Twitter API, which is kind of annoying. I mean, FOUR tokens? Also, I think you have to give Twitter your phone number to make a new app.",
      "lang" : "en",
