      "truncated" : false,
      "retweet_count" : "0",
      "id" : "1339619525227130881",
      "in_reply_to_status_id" : "1339619125333811209",
      "created_at" : "Thu Dec 17 17:12:38 +0000 2020",
      "favorited" : false,
      "full_text" : "I only published the script that generates tweet databases, not the databases themselves, for two reasons. First, I'd need their permission to do so, but second, the databases would go out of date immediately anyway. Better to give people tools to regenerate databases on demand.",
