      "created_at" : "Sun Jan 31 22:23:24 +0000 2021",
      "favorited" : false,
      "full_text" : "It wasn't _all the time_, though, which made it harder to figure out. Recently I realized I'd had this OWC Thunderbolt 3 Dock for a couple of months. When I disconnected it, even if I was using the battery and switching from wired Ethernet to wifi, everything got much faster!",
