      "full_text" : "Another reason to wish for Swift over RN is the tooling would be better. Look at these install instructions! I think this has to do with integrating with Xcode, which is difficult. If I could just write cross platform apps in Xcode, I would!\n\nhttps://t.co/ZMq1nQPgsu",
