      "created_at" : "Tue Feb 02 22:28:14 +0000 2021",
      "favorited" : false,
      "full_text" : "And by this, I am not meaning to complain about React Native, but to say that I'd be faster in Swift, which is more like what I'm used to (even though I'm not that familiar with Swift itself). It would be awesome to use Swift to write cross platform apps!",
