      "created_at" : "Tue Feb 02 22:27:14 +0000 2021",
      "favorited" : false,
      "full_text" : "I had to try it out both ways, rewriting code until I determined that no, probably it shouldn't be a hook, but it should be called from hooks which wrap around react-query hooks. You can't call hooks conditionally (!) or from non-hooks. Getting it wrong early means rewriting code",
