      "created_at" : "Tue Feb 02 22:25:38 +0000 2021",
      "favorited" : false,
      "full_text" : "One example of how these two things have impacted my project: I'm using react-native-sqlite-storage and react-query. I had to rewrite calls to my web API as hooks to use react-query. Now I want to add a local cache in SQLite. Should it be a hook?",
