      "full_text" : "I looked at Xamarin.Forms, and still wonder if that would have been a better solution than RN given my preferences. It seemed like it had some drawbacks on iOS and especially for UI, but itâ€™s possible I didnâ€™t dig enough and would be happier there... maybe for my next project ðŸ™ƒ",
