      "created_at" : "Thu Aug 01 04:13:54 +0000 2019",
      "favorited" : false,
      "full_text" : "The Pi 2 is very slow ðŸ˜µ at least compared to the Odroid HC2, so I have an Odroid XU4 in the mail to replace it. The XU4 and the HC2 are based off the same platform... kernels, device trees, etc can be shared.",
