      "created_at" : "Wed Oct 06 14:33:50 +0000 2021",
      "favorited" : false,
      "full_text" : "Often I'll find myself rewriting awkward opening sentences like that. \"Hey, just wanted to ping you about doing X\" instead of \"Will/Did you X?\". Part of it is trying to be non-confrontational, but I wonder if it's also that we see sentences like that in writing very often.",
