      "full_text" : "I currently use Hugo on GitHub Pages, which I really like for fully static sites, but I would really like to run code server side for plugins, and add some iOS editing support (maybe possible for Jekyll based GH Pages, but a pain for Hugo or anything else that isnâ€™t GH default)",
